contracts/Mozes.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Mozeshw2 is Initializable {
    uint private number;
    string constant name = "Mozeshello world";
     event NumberChanged(uint256 newNumber);
    //初始化函数
    function initialize(uint256 _initValue) public initializer {
        number = _initValue;
    }

    function setNumber(uint256 newNumber) public {
        number = newNumber;
        emit NumberChanged(newNumber);
    }

    // Reads the last value
    function getNumber() public view returns (uint256) {
        return number;
    }

    function getConstant() public pure returns (string memory){
        return string(abi.encodePacked(name));
    }
}

contracts/Mozes2.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
// Uncomment this line to use console.log
// import "hardhat/console.sol";
contract Mozes2hw2 is Initializable {
    uint private number;
     string constant name = "Mozes0559hello";
     event NumberChanged(uint256 newNumber);
    //初始化函数
    function initialize(uint256 _initValue) public initializer {
        number = _initValue;
    }

    function setNumber(uint256 newNumber) public {
        number = newNumber * 2;
        emit NumberChanged(number);
    }

    // Reads the last value
    function getNumber() public view returns (uint256) {
        return number;
    }

    function getConstant() public pure returns (string memory){
        return string(abi.encodePacked(name));
    }

}

